import React from "react"
import styled from "styled-components"

const Wrapper = styled.div`
margin-top:50px;
  width:600px;
  height:300px;
  margin: 10 auto;
  display:flex;
  background-color: #10375C;
  z-index:10;
`


const CardComponent = ({title}) => { 


    return(<><Wrapper></Wrapper></> );
}

export default CardComponent;
